import React, { useState } from 'react';
import UploadForm from './components/UploadForm';
import QuestionsDisplay from './components/QuestionsDisplay';
import './styles/App.css';

function App() {
  const [questions, setQuestions] = useState(null); // State to hold AI-generated questions

  return (
    <div className="app">
      <header>
        <h1>AI Interview Questions Generator</h1>
      </header>
      <main>
        <UploadForm setQuestions={setQuestions} />
        {questions && <QuestionsDisplay questions={questions} />}
      </main>
    </div>
  );
}

export default App;
